import React from "react";
import { Link } from "react-router-dom";

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to the Homepage</h1>
      <Link to="/login">Login/Signup</Link>
      <br />
      <Link to="/app">Go to App</Link>
    </div>
  );
};

export default HomePage;
